import './DataCard.css'

const DataCard = props => {

    const date = new Date()
    const months = ['January', 'February', 'March', 'April', 'May', 'June', 'July', 'August', 'September', 'Oct']
    const month = date.get

    return(
        <div className="card">
            <div className="card__top">
                <p className="card__top-month">September</p>
            </div>
            <div className="card__bottom">
                <p className="card__bottom-day-of-month">2</p>
                <p className="card__bottom-day-of-week">Sunday</p>
            </div>
        </div>
    );

}

export default DataCard
